import "./App.css";
import Header from "./components/Header";
import Seq from "./components/Seq";
import SeqProvider from "./store/SeqProvider";

function App() {

  return (
    <SeqProvider>
      <div className="main">
        <Header />
        <Seq />
      </div>
    </SeqProvider>
  );
}

export default App;
